import { useState } from 'react';
import ReactDOM from 'react-dom/client';

function Home() {
  return (
	<div>
		<h3>Bem-vindo ao teste de detecção de sigmanos!</h3>
		<h4>Utilização da página</h4>
		<p>Insira um array de strings</p>
		<p>Clique no botão para checar se a representação do DNA corresponde a um sigmano</p>
	</div>
  )
}

export default Home;
